import React, {Component} from 'react';
import classes from './Dialogs.module.css';
import {NavLink} from "react-router-dom";
import dialogsItems from "./dialogsItems/dialogsItems";
import messages from "./messages/messages"

const dialogItem = () => {
    return <div className={classes.dialog + ' ' + classes.active}>
        <NavLink to="/dialogs/1">Sasha</NavLink>
    </div>
}



const Dialogs = (props) => {
    return (
        <div className={classes.dialogs}>
            <div className={classes.dialogsItems}>
                <dialogitem/>
                <div className={classes.dialog + ' ' + classes.dialogItem}>
                    <NavLink to="/dialogs/2">Kolechka</NavLink>
                </div>
                <div className={classes.dialog}>
                    <NavLink to="/dialogs/3">Andrey</NavLink>
                </div>
                <div className={classes.dialog}>
                    <NavLink to="/dialogs/4">Chekatilo</NavLink>
                </div>
                <div className={classes.dialog}>
                    <NavLink to="/dialogs/5">Vorobey</NavLink>
                </div>
            </div>
            <div className={classes.messages}>
                <div className={classes.message}>Hi</div>
                <div className={classes.message}>Byhai</div>
                <div className={classes.message}>How is your wife?</div>
            </div>
        </div>
    )
};

export default Dialogs;
